import './App.css';
import {TaskList, renderRoute} from './TaskList';
import Modal from 'react-modal';
import { useState } from 'react';
import { Editor } from "@tinymce/tinymce-react";
import { IoMdContact } from 'react-icons/io'
import { RiGroupLine } from 'react-icons/ri'
import { BsBookmarkFill } from 'react-icons/bs'




Modal.setAppElement('#root');




function App() {
  const [modalIsOpen, setmodalIsOpen] = useState(false);
  return (

    <div className="Aside">
    <div className="Nav">
        <ul>
        <li className="Nav-selected"><a href="#">Home</a></li>
        <li><a href="index.html">Tasks</a></li>
        <li><a href="#">Projects</a></li>
        <li><a href="calendrier.html">Calendars</a></li>
        </ul>

    </div>

    <div className="Menu">

        <ul>
        <li className="selected"><a href=""> <IoMdContact/> My tasks</a></li>
        <li><a href=""> <BsBookmarkFill/> My Bookmarks</a></li>
        <hr/>
        <p/>
        <li><a href=""> <RiGroupLine/>  Team</a></li>

        </ul>
    </div>
    <div className="header">
        <p/>My tasks
          <button className="btn btn-primary" id="btn-tasks" onClick={() => setmodalIsOpen(true)}>Add Tasks</button>
          <hr/>
            <Modal isOpen={modalIsOpen} shouldCloseOnOverlayClick={false} onRequestClose={() => setmodalIsOpen(false)}
            style={
              {
                overlay:  {
                  background: 'rgba(0, 0, 0, 0.44'
                },
                content: {
                  color: 'grey',
                  width: '450px',
                  height:'450px',
                  right:'200px',
                  left:'500px',
                  top:'100px'
                },
              }
            }
            >
              <button className="btn btn-light" onClick={() => setmodalIsOpen(false)}

              style={
                 {
                   position: 'absolute',
                   right: '10px'
                 }
              }


              >X</button>
              <input type="checkbox" disabled/> 
              <p/>
              <div class="form-group row">
                <label for="colFormLabel" class="col-sm-2 col-form-label">Email</label>
                <div class="col-sm-10">
                  <input type="email" class="form-control" id="colFormLabel" placeholder="col-form-label"/>
                </div>
              </div>



              <br/><hr/>Classement<input type="text" className ="projet" style ={{ input: { border: 'none',}}} placeholder="Classement projet"/>
              <br/><hr/>Date de d√©but <input type="date" className ="Datebegin" style ={{ input: { border: 'none',}}} placeholder="Date"/>
              <hr/>
              <input type="text" style ={{ input: { border: '0', size: '40'}}} placeholder="Add notes"/><hr/>

            </Modal> 
    </div>
        <div className="cells">
        <TaskList/>
        </div>
</div>
  );
}


export default App;
